            {
              "date": "2023-03-18",
              "horse": "Equus Dancer",
              "horse_id": "1922298",
              "race": "Your Dream Holiday With Optimum Experience Handicap Hurdle",
              "race_id": "833516",
              "course": "Uttoxeter",
              "course_id": "crs_2184",
              "distance_f": "20",
              "distance_y": "4387",
              "quote": "Equus Dancer has been a good horse - he's very genuine and consistent. We were originally targeting the Topham but he didn't jump with much fluency last time and if he wasn't confident over normal fences he'd have no chance over the National ones! We'll go for a handicap hurdle at Aintree - Peter Bowen, trainer."
            },
            {
              "date": "2020-11-24",
              "horse": "Equus Dancer",
              "horse_id": "1922298",
              "race": "MansionBet Best Odds Guaranteed Novices' Handicap Chase (GBB Race)",
              "race_id": "770444",
              "course": "Sedgefield",
              "course_id": "crs_1482",
              "distance_f": "19.5",
              "distance_y": "4245",
              "quote": "Equus Dancer wasn't right last season, he had a lot of trouble with his feet. But he seems to have come right now. We'll have a look for something in three or four weeks and we'll see what the handicapper does but he's got a bit of experience now so he could go for something a bit better. He'll go a bit further as well - Peter Bowen, trainer."
            },
            {
              "date": "2019-03-24",
              "horse": "Equus Dancer",
              "horse_id": "1922298",
              "race": "Baldwinholme Standard Open National Hunt Flat Race",
              "race_id": "723083",
              "course": "Carlisle",
              "course_id": "crs_208",
              "distance_f": "17",
              "distance_y": "3740",
              "quote": "Equus Dancer is a lovely horse. The track was too sharp for him at Catterick last time and the ground was too quick - Peter Bowen, trainer."
            }
