          "comment": "Disappointing at Ripon last week but she's generally reliable and could bounce back",
          "spotlight": "Won two in a row last August and latest was off this mark at Ripon (1m2f); been expensive to follow since and was disappointing at Ripon last week, but that was after a sequence of solid efforts; conditions are no problem and it wouldn't be a surprise if she bounced back with a big run.",
