              "distance_f": "10",
              "distance_y": "2150",
              "quote": "We were unsure as Bay Dream Believer had a 5lb penalty and was only put up 2lb for her last win so it was a bit of a gamble but the prize money was good for the grade and she came out of the race really well. She's only a little pony but she tries hard - trainer Mark Walford."
