          "comment": "In pretty good form (including here) prior to Wetherby last time, when he had an excuse",
          "spotlight": "Good third off this mark over C&D last month on final run for Kevin Ryan and eyecatching fifth on stable debut at Doncaster (1m, good) next time when denied a clear run; reportedly galloped into and lost his action when eased mid-race at Wetherby last week; capable of being in the mix.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-09-15",
              "horse": "Chuzzlewit",
              "horse_id": "4392907",
              "race": "British Stallion Studs EBF Novice Stakes (GBB Race) (IRE Incentive Race)",
              "race_id": "819613",
              "course": "Ayr",
              "course_id": "crs_78",
              "distance_f": "7",
              "distance_y": "1590",
              "quote": "I think the world of Chuzzlewit. He relaxed lovely today but he was still green and backward and there is more to come. He shows speed at home but he'll have no problem staying a mile next year. He won't run again until next year, he'll keep progressing and I don't know how good he could be - Kevin Ryan, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Chuzzlewit",
              "horse_id": "4392907",
              "quote": "He travelled very strongly through the Lincoln but just got a bit lost when he was let down on the testing ground. It was a better run than his finishing position suggests and we know now not to run in such testing conditions again. He's another who could be competitive in some of those decent 7f-mile handicaps in the summer. 04-04-24"
            },
            {
              "horse": "Chuzzlewit",
              "horse_id": "4392907",
              "quote": "I really like what I have seen from this colt who is a half-brother to triple Group 1 winner Advertise out of a particularly good Cheveley Park mare. He is doing everything nicely at home although I am not pressing too many buttons too soon, so he will be ready hopefully by the middle of next month, but definitely one to look out for. 15-06-22"
            }
          ],
