          "spotlight": "AW record of 3111123 and she was bang there, showing her best form, when placed on last two occasions; latest start was valuable 1m2f handicap at the big Easter meeting at this track; moves into a Group 3 after ten-week break but has the form for another prominent finish and she's improving.",
