          "comment": "Three course wins; good run at Epsom latest; stall 1 perhaps not ideal this time",
          "spotlight": "Three course wins; ran a solid race when third at Epsom three weeks ago (6f, soft; a race he had won in 2023); 2lb rise shouldn't be beyond him but stall 1 perhaps not optimal.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-06-03",
              "horse": "Badri",
              "horse_id": "2806549",
              "race": "JRA Tokyo Trophy Handicap",
              "race_id": "839638",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "6",
              "distance_y": "1323",
              "quote": "We were thinking Badri was just an all-weather horse. We ran him at Beverley as we thought a stiff five would suit. He romped home and he wasn't disgraced at York. It didn't look like he was coming down the hill but he was doing his best work where it mattered most. We tried him on the grass last year and he didn't really look like he suited it but my horses are running much better this year and that is sometimes how it goes. We were thinking about the Gosforth Park Cup as he's unbeaten over five furlongs at Newcastle, and there's also a big five-furlong handicap at Ascot in July - we had that in mind thinking that a stiff five at Ascot would suit him - Ruth Carr, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Badri",
              "horse_id": "2806549",
              "quote": "He's a classy horse who is new to us having been acquired out of Ruth Carr's yard following four wins this year. He joins the yard with a rating of 100 and I must praise Ruth, who did a great job with him - I've been very pleased with him since he arrived. We're going to stick to what we know he does best and that is sprint handicaps. He ran in a 5f handicap at Newcastle last week, coming from off the pace to finish a highly creditable second. Looking ahead, there is the Portland Handicap and the 6f International Handicap at York we may consider. 06-09-23"
            }
          ],
