          "comment": "Quirky but capable off this mark; headgear experiment aborted; each-way shout",
          "spotlight": "Unlikely his current mark is beyond him and his latest Doncaster run probably isn't the one to judge him on; cheekpieces left off today; effective on Tapeta; quirky and it's a plus that Silvestre De Sousa has won on him in the past.",
