          "comment": "Running well at Hamilton this summer; 0-13 on AW but has run well over C&D in the past",
          "spotlight": "Landed a 5f handicap at Hamilton in May and he's run well in defeat back at that track twice since; 0-13 on AW but he has run well over C&D in the past; not discounted in his current form.",
