          "comment": "Three 5f wins this year; not beaten far at Ayr latest; shouldn't be far away",
          "spotlight": "Three 5f wins this year, two of them on Tapeta at Southwell; not beaten far at Ayr last month and he's likely to be involved once again.",
          "medical": [],
          "quotes": [
            {
              "date": "2021-04-23",
              "horse": "Nelson Gay",
              "horse_id": "3057719",
              "race": "bet365 Handicap",
              "race_id": "780441",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "I felt justified running Nelson Gay in the Norfolk last season after he was beaten at Yarmouth, but it just didn't happen for him last year until he fell in in a bad maiden at Southwell. He won well at Wolverhampton last time, which was the first stepping stone to better things and he was very good. I didn't expect him to win eight lengths, but he's in a race at Goodwood next week or we'll go for the five-furlong handicap at Royal Ascot - Richard Hughes, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Nelson Gay",
              "horse_id": "3057719",
              "quote": "He ran well at Wolverhampton last time when runner-up to Phoenix Beach. There probably weren't enough runners for him - it's better if he runs into a bit of trouble. A furlong out it looked like he had the beating of the winner but he just hesitated. I'd be half tempted to put a set of blinkers on him next time. He seems to like the all-weather but I'm not sure where we'll go next. 28-08-24"
            }
          ],
