              "quote": "Jungle Cove is a star. He's basically my lead horse at home. Emma-Jayne gave him a fabulous ride and said she knew he was going to win a furlong out; that she had so much horse underneath. I knew he'd pick up. He goes on any ground - Jessica Harrington, trainer."
